import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for at least one product price to be visible
    await page.waitForSelector('.product-price', { timeout: 5000 });

    // Take screenshot of product grid area if possible
    const productsGrid = await page.$('.products-grid');
    if (productsGrid) {
      await productsGrid.screenshot({ path: path.join(screenshotsDir, 'step_2_products_grid.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_products_grid.png'));
    }

    // Extract all product prices visible on the page
    const prices = await page.$$eval('.product-price', nodes =>
      nodes.map(node => node.textContent.trim())
    );

    // Also extract product titles for verification
    const titles = await page.$$eval('.product-title', nodes =>
      nodes.map(node => node.textContent.trim())
    );

    // Compose extracted data
    const extractedData = [];
    for (let i = 0; i < Math.max(prices.length, titles.length); i++) {
      extractedData.push({
        title: titles[i] || null,
        price: prices[i] || null
      });
    }

    return {
      success: true,
      action: "Extracted all product prices and titles from the page",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
